window.bookSummaryJSON = "<p><b>Pride and prejudice. Humanity's prejudice against a Demon's pride.</b></p> <p>After officially becoming a Gold Rank adventurer, Salvos leaves the Nixa and departs on a new adventure to grow even stronger and find a way back to her companion. She will have to face [Cultists], assassins, and the threat of a company war — something she may or may not have instigated — while she battles against the prejudice the world itself holds against her, because she is a <i>Demon.</i></p> <p>The story of Salvos continues!</p>"; 
